// components/About.js
import React from 'react';
import { motion } from 'framer-motion';

const About = () => {
  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: { staggerChildren: 0.2 }
    }
  };

  const itemVariants = {
    hidden: { y: 30, opacity: 0 },
    visible: {
      y: 0,
      opacity: 1,
      transition: { duration: 0.6, ease: "easeOut" }
    }
  };

  const stats = [
    { number: "5+", label: "Projects Completed" },
    { number: "2+", label: "Years Experience" },
    { number: "10+", label: "Technologies" },
    { number: "2", label: "Research Papers" }
  ];

  return (
    <motion.section
      className="section"
      variants={containerVariants}
      initial="hidden"
      animate="visible"
      id="about"
    >
      <div className="section-header">
        <h2 className="section-title">About Me</h2>
        <div className="section-divider"></div>
        <p className="section-subtitle">Get to know me better</p>
      </div>

      <div className="max-w-6xl mx-auto">
        <div className="space-y-16">

          {/* Main content */}
          <div className="grid grid-cols-1 lg:grid-cols-2 gap-16 items-center">

            {/* Left Text Section */}
            <div>
              {/* Who I Am */}
              <motion.div className="mb-8" variants={itemVariants}>
                <div className="flex items-center gap-3 mb-4">
                  <div className="w-10 h-10 bg-gradient-to-br from-primary-500 to-accent-500 rounded-full flex items-center justify-center">
                    <i className="fas fa-user text-white text-sm"></i>
                  </div>
                  <h3 className="text-xl font-semibold text-dark-50">Who I Am</h3>
                </div>
                <p className="text-lg text-dark-300 leading-relaxed pl-13">
                  I'm a passionate <span className="text-primary-400 font-semibold">Data Scientist</span> and{' '}
                  <span className="text-accent-400 font-semibold">Machine Learning Engineer</span> with expertise in
                  developing AI-powered solutions. My journey began with curiosity about
                  how data unlocks meaningful insights and innovations.
                </p>
              </motion.div>

              {/* Education */}
              <motion.div className="mb-8" variants={itemVariants}>
                <div className="flex items-center gap-3 mb-4">
                  <div className="w-10 h-10 bg-gradient-to-br from-accent-500 to-secondary-500 rounded-full flex items-center justify-center">
                    <i className="fas fa-graduation-cap text-white text-sm"></i>
                  </div>
                  <h3 className="text-xl font-semibold text-dark-50">Education & Expertise</h3>
                </div>
                <p className="text-lg text-dark-300 leading-relaxed pl-13">
                  Currently pursuing my Master's in Data Science with hands-on expertise in
                  machine learning pipelines â€” from data preprocessing to deployment.
                  Strong interests: NLP, Computer Vision & real-world AI applications.
                </p>
              </motion.div>

              {/* Beyond Code */}
              <motion.div className="mb-8" variants={itemVariants}>
                <div className="flex items-center gap-3 mb-4">
                  <div className="w-10 h-10 bg-gradient-to-br from-secondary-500 to-primary-500 rounded-full flex items-center justify-center">
                    <i className="fas fa-heart text-white text-sm"></i>
                  </div>
                  <h3 className="text-xl font-semibold text-dark-50">Beyond Code</h3>
                </div>
                <p className="text-lg text-dark-300 leading-relaxed pl-13">
                  I enjoy exploring new technologies, contributing to open-source,
                  and sharing knowledge with budding data enthusiasts.
                </p>
              </motion.div>

              {/* Tech Stack */}
              <motion.div variants={itemVariants}>
                <div className="flex items-center gap-3 mb-4">
                  <div className="w-10 h-10 bg-gradient-to-br from-primary-500 to-accent-500 rounded-full flex items-center justify-center">
                    <i className="fas fa-code text-white text-sm"></i>
                  </div>
                  <h3 className="text-xl font-semibold text-dark-50">Core Technologies</h3>
                </div>

                <div className="flex flex-wrap gap-3 pl-13">
                  {[
                    { name: 'Python', icon: 'fab fa-python' },
                    { name: 'Machine Learning', icon: 'fas fa-brain' },
                    { name: 'Deep Learning', icon: 'fas fa-network-wired' },
                    { name: 'React', icon: 'fab fa-react' },
                    { name: 'AWS', icon: 'fab fa-aws' }
                  ].map(skill => (
                    <span
                      key={skill.name}
                      className="px-4 py-2 bg-primary-500/10 text-primary-300 rounded-full text-sm font-medium border border-primary-500/20 flex items-center gap-2"
                    >
                      <i className={`${skill.icon} text-xs`}></i>
                      {skill.name}
                    </span>
                  ))}
                </div>
              </motion.div>
            </div>

            {/* Right Stats Cards */}
            <motion.div
              className="grid grid-cols-2 gap-6"
              variants={containerVariants}
            >
              {stats.map(stat => (
                <motion.div
                  key={stat.label}
                  className="text-center p-6 bg-gradient-to-br from-dark-800 to-dark-900 rounded-xl border border-dark-700 hover:border-primary-500/50 transition-colors duration-300"
                  variants={itemVariants}
                >
                  <div className="text-4xl font-bold text-primary-400 mb-2">{stat.number}</div>
                  <div className="text-dark-300 text-sm font-medium">{stat.label}</div>
                </motion.div>
              ))}
            </motion.div>
          </div>

          {/* CTA Button */}
          <motion.div className="text-center mt-16" variants={itemVariants}>
            <a href="#experience" className="btn btn-primary text-lg px-8 py-4">
              <i className="fas fa-arrow-down mr-2"></i>
              Explore My Journey
            </a>
          </motion.div>
        </div>
      </div>
    </motion.section>
  );
};

export default About;
